import React from 'react';

import {
  DisplayContainer
} from './DisplayStyles';

const Display = ({ heading, outputText }) => (
  <DisplayContainer>
    <h3>From {heading}</h3>
    <p>To {outputText}</p>
  </DisplayContainer>
)

export default Display;
